const FAVICON_ID = 'favicon-packs-favicon'

async function setSiteConfigsOrder (siteConfigs) {
  const siteConfigsOrder = await window.extensionStore.getPreference(
    'siteConfigsOrder'
  )

  if (siteConfigsOrder?.length !== 2) {
    await window.extensionStore.updatePreference(
      'siteConfigsOrder',
      siteConfigs.map(config => config.id)
    )
  }
}

function waitForElement (selector, amount, callback, waitTime) {
  if (document.querySelectorAll(selector).length === amount) {
    callback()
  } else {
    setTimeout(() => {
      waitForElement(selector, amount, callback, waitTime)
    }, waitTime)
  }
}

function getColorScheme () {
  fpLogger.debug('getColorScheme()')
  return window.matchMedia('(prefers-color-scheme: dark)').matches
    ? 'dark'
    : 'light'
}

async function getSiteConfigs () {
  const siteConfigsOrder = await window.extensionStore.getPreference(
    'siteConfigsOrder'
  )

  const siteConfigs = siteConfigsOrder.map(
    async id => await window.extensionStore.getSiteConfigById(id)
  )

  return Promise.all(siteConfigs)
}

async function replaceFavicon (siteConfigId) {
  fpLogger.debug('replaceFavicon()')

  const siteConfig = await window.extensionStore.getSiteConfigById(siteConfigId)

  const darkThemeEnabled = await window.extensionStore.getPreference(
    'darkThemeEnabled'
  )
  fpLogger.debug('darkThemeEnabled', darkThemeEnabled)

  const lightThemeEnabled = await window.extensionStore.getPreference(
    'lightThemeEnabled'
  )
  fpLogger.debug('lightThemeEnabled', lightThemeEnabled)

  let imgUrl

  const colorScheme = getColorScheme()
  fpLogger.debug('colorScheme', colorScheme)

  switch (colorScheme) {
    case null:
      break
    case 'dark':
      if (darkThemeEnabled) imgUrl = siteConfig.darkPngUrl
      break
    default:
      if (lightThemeEnabled) imgUrl = siteConfig.lightPngUrl
      break
  }

  fpLogger.debug('imgUrl', imgUrl)

  // Remove existing favicon if present
  const existingFavicon = document.getElementById(FAVICON_ID)
  if (existingFavicon) existingFavicon.remove()

  const link = document.createElement('link')
  link.rel = 'shortcut icon'
  link.type = 'image/png'
  link.id = FAVICON_ID
  link.href = imgUrl

  currentFaviconHref = imgUrl

  document.head.appendChild(link)
}

async function updateCurrentFavicon () {
  fpLogger.debug('updateCurrentFavicon()')

  const siteConfigs = await window.extensionStore.getActiveSiteConfigs()
  fpLogger.debug('siteConfigs', siteConfigs)

  if (siteConfigs.length) {
    const siteConfigsOrder = await window.extensionStore.getPreference(
      'siteConfigsOrder'
    )
    fpLogger.debug('siteConfigsOrder', siteConfigsOrder)

    const sortedSiteConfigs = siteConfigsOrder
      .map(id => siteConfigs.find(siteConfig => siteConfig.id === id))
      .filter(Boolean)

    fpLogger.debug('sortedSiteConfigs', sortedSiteConfigs)

    const siteConfig = sortedSiteConfigs.find(localSiteConfig => {
      if (!localSiteConfig.websitePattern) return false
      if (!localSiteConfig.iconId && !localSiteConfig.uploadId) return false

      let websitePattern = localSiteConfig.websitePattern
      fpLogger.debug('websitePattern', websitePattern)

      if (localSiteConfig.patternType === 0) {
        const escapedDomain = websitePattern.replace(
          /[-/\\^$*+?.()|[\]{}]/g,
          '\\$&'
        )
        websitePattern = `.*${escapedDomain}.*`
        fpLogger.debug('websitePattern', websitePattern)
      }

      try {
        const regexp = new RegExp(websitePattern, 'i')
        fpLogger.debug('regexp', websitePattern)

        const matches = regexp.test(window.location.href)
        fpLogger.debug('matches', matches)

        return matches
      } catch (error) {
        fpLogger.error('Error creating RegExp', error)
        return false
      }
    })

    if (siteConfig) replaceFavicon(siteConfig.id)
  } else {
    const existingFavicon = document.getElementById(FAVICON_ID)
    if (existingFavicon) {
      existingFavicon.remove()

      const defaultFavicon = document.querySelector(
        '#favicon-packs-default-favicon'
      )
      document.head.appendChild(defaultFavicon.cloneNode(true))
      defaultFavicon.remove()
    }

    const defaultLinkId = 'favicon-packs-default-favicon'

    if (!document.getElementById(defaultLinkId)) {
      const defaultLink = document.createElement('link')
      defaultLink.id = defaultLinkId
      defaultLink.type = 'image/svg+xml'
      defaultLink.href = 'src/img/logo.svg'
      defaultLink.rel = 'icon'
      document.head.appendChild(defaultLink)
    }
  }
}

document.addEventListener('DOMContentLoaded', async function () {
  await window.extensionStore.initialize()

  const addOnDiv = document.createElement('div')
  addOnDiv.className = 'center'
  addOnDiv.style.position = 'fixed'
  addOnDiv.style.bottom = '2rem'
  addOnDiv.style.width = '100%'

  const addOnLink = document.createElement('a')
  addOnLink.href =
    'https://addons.mozilla.org/en-US/firefox/addon/favicon-packs/'
  addOnLink.target = '_blank'
  addOnLink.rel = 'noopener noreferrer'
  addOnLink.style.width = '15%'
  addOnLink.style.display = 'inline-block'

  const addOnImg = document.createElement('img')
  addOnImg.src = 'src/demo/get-the-addon.svg'
  addOnImg.alt = 'Get the add-on'

  addOnLink.appendChild(addOnImg)
  addOnDiv.appendChild(addOnLink)

  document.querySelector('.content').insertAdjacentElement('afterend', addOnDiv)

  const siteConfigs = await window.extensionStore.getSiteConfigs()
  fpLogger.debug('siteConfigs', siteConfigs)

  if (siteConfigs.length === 0) {
    const siteConfig1 = await window.extensionStore.addSiteConfig({
      websitePattern: 'faviconpacks.com',
      iconId: 'Ionicons-7.4.0-star',
      patternType: 0,
      active: 1,
      lightThemeColor: '#ff7fff',
      darkThemeColor: '#ffff80',
      anyThemeColor: '#808080',
      lightPngUrl:
        'data:image/png;base64,',
      darkPngUrl:
        'data:image/png;base64,',
      anyPngUrl:
        'data:image/png;base64,'
    })
    const siteConfig2 = await window.extensionStore.addSiteConfig({
      websitePattern: 'faviconpacks.com',
      iconId: 'Ionicons-7.4.0-home-outline',
      patternType: 0,
      active: 1,
      lightThemeColor: '#7fff7f',
      darkThemeColor: '#7e7eff',
      anyThemeColor: '#808080',
      lightPngUrl:
        'data:image/png;base64,',
      darkPngUrl:
        'data:image/png;base64,',
      anyPngUrl:
        'data:image/png;base64,'
    })

    setSiteConfigsOrder([siteConfig1, siteConfig2])
  } else if (siteConfigs.length === 2) {
    setSiteConfigsOrder(siteConfigs)
  }

  const storeIcons = await window.extensionStore.getIcons()
  fpLogger.debug('storeIcons', storeIcons)

  if (storeIcons.length === 0) {
    const idbDatabase = window.extensionStore.getDatabase()
    fpLogger.verbose('idbDatabase', idbDatabase)

    await window.importFromJson(idbDatabase, JSON.stringify(window.fpIcons))
  }

  const disabledSelectors = [
    '#create-dropdown > sl-button',
    '#delete-action-button',
    '#duplicate-action-button',
    '#import-action-button',
    '#export-dropdown > sl-button'
  ]
  disabledSelectors.forEach(selector => {
    document.querySelector(selector).setAttribute('disabled', true)
  })

  const siteConfigRowSelector = '.siteConfig-row'
  const callback = async () => {
    const rows = document.querySelectorAll(siteConfigRowSelector)
    const siteConfigMetadata = []

    for await (row of rows) {
      const id = row.id.split('row-')[1]
      const siteConfig = await window.extensionStore.getSiteConfigById(id)

      siteConfigMetadata.push({
        row,
        siteConfig
      })
    }

    updateCurrentFavicon()

    siteConfigMetadata[0].row
      .querySelector('.increment')
      .addEventListener('click', async () => {
        await replaceFavicon(siteConfigMetadata[0].siteConfig.id)
      })
    siteConfigMetadata[0].row
      .querySelector('.decrement')
      .addEventListener('click', async () => {
        await replaceFavicon(siteConfigMetadata[1].siteConfig.id)
      })

    siteConfigMetadata[1].row
      .querySelector('.increment')
      .addEventListener('click', async () => {
        await replaceFavicon(siteConfigMetadata[1].siteConfig.id)
      })
    siteConfigMetadata[1].row
      .querySelector('.decrement')
      .addEventListener('click', async () => {
        await replaceFavicon(siteConfigMetadata[0].siteConfig.id)
      })

    const updateCurrentFaviconAfterDelay = () => {
      fpLogger.debug('updateCurrentFaviconAfterDelay()')
      setTimeout(updateCurrentFavicon, 500)
    }

    document
      .querySelectorAll('.color-cell sl-color-picker')
      .forEach(colorPicker => {
        colorPicker.addEventListener('sl-blur', event => {
          event.target.updateComplete.then(updateCurrentFaviconAfterDelay)
        })
      })

    document
      .querySelectorAll('.active-cell sl-switch')
      .forEach(switchToggle => {
        switchToggle.addEventListener('sl-input', event => {
          event.target.updateComplete.then(updateCurrentFaviconAfterDelay)
        })
      })

    document
      .querySelector('#save-icon-button')
      .addEventListener('click', updateCurrentFaviconAfterDelay)

    document.querySelectorAll('.site-cell.edit').forEach(form => {
      form.addEventListener('submit', updateCurrentFaviconAfterDelay)
    })
  }
  waitForElement(siteConfigRowSelector, 2, callback, 100)
})
